import React from 'react';
import { Link } from 'react-router-dom';

function HomePage() {
  return (
    <div style={{ textAlign: 'center', marginTop: '100px' }}>
      <img src="/quiz-logo.png" alt="Quiz Logo" style={{ width: '150px' }} />
      <h1>Welcome to the Quiz App</h1>
      <div style={{ marginTop: '40px' }}>
        <Link to="/admin-login" style={{ margin: '20px', fontSize: '20px' }}>Admin Login</Link>
        <Link to="/user-login" style={{ margin: '20px', fontSize: '20px' }}>User Login</Link>
      </div>
    </div>
  );
}

export default HomePage;
